def decode(NA, CA, NB):
	p = gmpy.gcd(NA, NB)
	q = NA / p 
	assert(p*q == NA)
	# print p 
	# print q 
	phi = (p-1)*(q-1)
	d = gmpy.invert(e, phi)
	m = pow(CA, d, NA)
	assert(pow(m, e, NA) == CA)
	print ("%01024x" % m).decode('hex')

decode(N0, C0, N1)

